import * as Blockly from 'blockly';

export const jsonGenerator = new Blockly.Generator('JSON');

export const forBlock = function(block) {
    const branch = Blockly.jsonGenerator.statementToCode(block, 'DO');
    let code = 'for (let i = 0; i < ' + block.getFieldValue('TIMES') + '; i++) {\n' +
        branch + '}\n';
    return code;
    }
